    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Seedskadee NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Seedskadee NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, a description of Refuge resources, information
    on the management direction, and implementation strategies. Key planning issues
    include: wildlife and habitat management, public use, and administration.",nt"license_title":
